        <img src={logo} alt='Blog de Baudouin et Dael' className='bg-logo'/>
        <h1 className='bg-title'>Blog Baudouin et Dael</h1>
      </Banner>
      <div className=''>
        <Favoris />
        <ArticlesList />
      </div>

      <Footer />
    </div>
  );
}

export default App;
